import './App.css';
import { Header } from './header.js';
import { Home } from './home.js';
import { Footer } from './footer.js';

function App() {
  return (
  <div>
    <Header/>
    <Home/>
    <Footer className='footer'/>
  </div>
  );
}

export default App;
